import style from "./SearchOptionTime.module.css";

import InputCheckbox from "../../../../UI/InputCheckbox/InputCheckbox";

import { HiOutlineMinusCircle } from "react-icons/hi";

function SearchOptionTime() {
  return (
    <div>
      <InputCheckbox label="time" id="time" defaultChecked={false} />
      <div>
        <InputCheckbox label="today" id="today" defaultChecked={false} />
        <InputCheckbox
          label="yesterday"
          id="yesterday"
          defaultChecked={false}
        />
        <InputCheckbox
          label="three days ago"
          id="three days ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a week ago"
          id="a week ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a month ago"
          id="a month ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="three months ago"
          id="three months ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="six months ago"
          id="six months ago"
          defaultChecked={false}
        />
        <InputCheckbox
          label="a year ago"
          id="a year ago"
          defaultChecked={false}
        />
      </div>
    </div>
  );
}

export default SearchOptionTime;
